inputStrings = [
""
,""
,""
,""
,""
]

MIN = 0
MAX = 2
keyPad = [[1,2,3],[4,5,6],[7,8,9]]
lastX = 1
lastY = 1

for inputString in inputStrings:
    #print(inputString)
    for instruction in inputString:
        #print(instruction)
        if instruction == 'L':
            if lastX > MIN:
                lastX -= 1
        elif instruction == 'R':
            if lastX < MAX:
                lastX += 1
        elif instruction == 'U':
            if lastY > MIN:
                lastY -= 1
        elif instruction == 'D':
            if lastY < MAX:
                lastY += 1

    print(keyPad[lastY][lastX],'','')

print();


